function Navbar (){
    return (
        <nav class="navbar navbar-light bg-light">
            <div class="container-fluid">
                <a class="navbar-brand" href="#">
                <img src={Logo} alt="" width="50" class="d-inline-block align-text-top"/>
                Bootstrap
                </a>
            </div>
        </nav>
    )
}

export default Navbar;
